import React from 'react';
import { Link } from 'react-router-dom';
import { VscGithub } from "react-icons/vsc";


const Footer = () => {
    return (
        <footer className="bg-slate-800 h-52 text-white flex justify-between items-end py-4">
            <p className='font-mono text-sm'>Based on the <Link className='text-sky-300 hover:underline hover:text-indigo-300' to={"https://www.madetomeasure.online/de/"}>Made to Measure</Link> project</p>

            <p> Hello <VscGithub /> </p>
        </footer>
    );
};

export default Footer;
